The Curry Secret: Indian Restaurant Cookery at Home (Right Way S.)by Kris Dhillon 

This is the curry book with a difference! It reveals the secrets of Indian Restaurant Cooking, usually closely guarded by chefs worldwide, so that you can reproduce that elusive taste in your own kitchen. Learn how to create chicken, lamb, fish and vegetable curries of mouth-watering quality, as well as a wide variety of other Indian dishes.
Kris Dhillon writes with the authority of an accomplished Indian restaurateur, with many years experience and thousands of satisfied customers. Most chefs guard closely the secret of their basic curry sauce, but in this book Kris Dhillon reveals all, and offers you the opportunity to reproduce that elusive taste, in your own kitchen.

